import React from 'react';
import { BrowserRouter, Route} from 'react-router-dom';

const pageOne = () => {
    return <div>Page one</div>
}

const pageTwo = () => {
    return <div><button>Click me</button></div>
}

const clickevent = () => {
    alert('Triggered');
}


    const App = () => {
        return (
        <div>
            <BrowserRouter>
                <div>
                <Route path="/" exact component={pageOne} />
                <Route path="/pageTwo" component={pageTwo} onCLick={clickevent} />
                </div>
                
            </BrowserRouter>
           
        </div>
        )
    } 

    

export default App;
